onChange.script:
self.custom.reset = False
payload = self.params.Filters
# get shelter list
query_shelter = """
SELECT facilityName FROM lodging.Facility WHERE facilityName IS NOT NULL AND timeRetired IS NULL ORDER BY facilityName
	"""
result_shelter = system.db.runPrepQuery(query_shelter,[],'RITIOps')
shelterList = ''
if payload['shelter'] != None and payload['shelter'] != '':
	for shelter in payload['shelter']:
		system.perspective.print(shelter)
		if shelter == 'All Guest House':
			query = """
			SELECT facilityName FROM lodging.Facility WHERE facilityName IS NOT NULL AND facilityName NOT IN ('532 Apartments','705 Apartments') AND timeRetired IS NULL ORDER BY facilityName
				"""
			result = system.db.runPrepQuery(query,[],'RITIOps')
			shelter_All = [ dict(shelter_one = x[0]) for x in result]
			if len(shelter_All)>0:
				for shelter_one in shelter_All:
					if shelterList != '':
						shelterList = shelterList + ", '" + (str(shelter_one['shelter_one'])).replace("'","''") + "'"
					else:
						shelterList = shelterList + "'" + (str(shelter_one['shelter_one'])).replace("'","''") + "'"
			else:
				shelterList = "('')"
			system.perspective.print(shelterList)
		else:
			if shelterList != '':
				shelterList = shelterList + ", '" + (str(shelter)).replace("'","''") + "'"
			else:
				shelterList = shelterList + "'" + (str(shelter)).replace("'","''") + "'"
	shelterList = '(' + str(shelterList) + ')'
else:
	shelterAll = [ dict(shelter = x[0]) for x in result_shelter]
	for shelter in shelterAll:
		if shelterList != '':
			shelterList = shelterList + ", '" + (str(shelter['shelter'])).replace("'","''") + "'"
		else:
			shelterList = shelterList + "'" + (str(shelter['shelter'])).replace("'","''") + "'"
	shelterList = '(' + str(shelterList) + ')'

# Get program list
query_program = """
SELECT programName FROM interaction.Program WHERE programName IS NOT NULL ORDER BY programName
	"""
result_program = system.db.runPrepQuery(query_program,[],'RITIOps')	
programList = ''
if payload['program'] != None and payload['program'] != '':
	for program in payload['program']:
		if programList != '':
			programList = programList + ", '" + str(program) + "'"
		else:
			programList = programList + "'" + str(program) + "'"
	programList = '(' + str(programList) + ')'
else:
	programAll = [ dict(program = x[0]) for x in result_program]
	programList = "' '"
	for program in programAll:
		if programList != '':
			programList = programList + ", '" + str(program['program']) + "'"
		else:
			programList = programList + "'" + str(program['program']) + "'"
	programList = '(' + str(programList) + ')'

# append payload values to filter	
Filters = {
		  "shelter": shelterList,
		  "gender": payload['gender'],
		  "race": payload['race'],
		  "program": programList,
		  "dateRangeTo": payload['dateRangeTo'],
		  "dateRangeFrom": payload['dateRangeFrom'],
		  "searchText": payload['searchText'],
		  "ExitDestination": payload['ExitDestination'],
		  "provider": payload['provider'],
		  "veteranId": payload['veteranId']
		}
self.custom.Filters = Filters

if previousValue is not None and currentValue is not None:
	if previousValue.value == 0 and currentValue.value == 1:
		self.getChild("Table").doByCondition({})
